import React from 'react'
import { Album, Title } from './Styled'


function Albums() {
  return (
    <>
      <Title padding='20px 0'>Popular Albums</Title>
      <Album>
        <img src='' alt="" />
      </Album>
    </>
  );
}

export default Albums
